syntax = "proto3";
package youtube.response.frameworkUpdate;

message FrameworkUpdateTransport{
  EntityBatchUpdate entityBatchUpdate = 1;
}
message EntityBatchUpdate{
  repeated Mutation mutations = 1;
}
message Mutation{
  string entityKey = 1;
  int32 type = 2;
  Payload payload = 3;
}
message Payload{

}